import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';


function handleKeyDown(evt, setLetter) {
  console.log(evt)
  return evt
}

function App() {
  const [currentLetter, setLetter] = useState(null);

  return (
    <div tabIndex="0" className="App" onKeyDown={(evt) => handleKeyDown(evt, setLetter)}>
      <div style={{
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center'
      }}>
        <div>
          Type a letter!
        </div>
      </div>
    </div>
  );
}

export default App;
